const add = function(num1, num2) {
	addResult = num1 + num2;
  return addResult;
};

const subtract = function(num1, num2) {
	subResult = num1 - num2;
  return subResult;
};

const sum = function(arr) {
  var total = 0;
  arr.forEach(function(num) {
    total += num;
  });
  return total;
};

